To get the GNSS timestamp on an Android device, follow these steps:

1.  **Enable Location Services**: Go to your Android device's Settings, then navigate to "Location" or "Location services." Ensure that the location services are enabled. This will allow your device to access the GNSS data.
2.  **Choose a GNSS Provider**: You can use the device's built-in GNSS provider or a third-party app. Some popular options include Google Location Services, OpenStreetMap, or other location-based apps.
3.  **Access the GNSS Data**: You can access the GNSS data through the Android API or by using a third-party app that provides GNSS information. For example, you can use the `LocationManager` class in Android to get the current location and timestamp.
4.  **Extract the Timestamp**: Once you have accessed the GNSS data, you can extract the timestamp from the location object. The timestamp is usually represented as a `long` value in milliseconds since the Unix epoch (January 1, 1970, 00:00:00 UTC).

Here's a simple example using the `LocationManager` class:

```java
import android.location.Location;
import android.location.LocationManager;
import android.os.Bundle;
import android.util.Log;

public class MainActivity extends AppCompatActivity {
    private LocationManager locationManager;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        locationManager = (LocationManager) getSystemService(Context.LOCATION_SERVICE);
        Location location = locationManager.getLastKnownLocation(LocationManager.GPS_PROVIDER);
        if (location!= null) {
            long timestamp = location.getTime();
            Log.d("GNSS Timestamp", "Timestamp: " + timestamp);
        }
    }
}
```

Please note that this is a basic example and might require additional permissions and handling for production use. Always ensure you follow the Android guidelines and best practices when working with location-based services.

