To create an HTML page that lists 25 limericks about people named "Bill" and includes the keywords "economist" and "Jurgen," you can follow these steps:

### HTML Structure

```html
<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Limericks about Bill</title>
    <style>
        body {
            font-family: Arial, sans-serif;
        }

       .limerick {
            margin-bottom: 20px;
        }
    </style>
</head>
<body>
    <h1>Limericks about Bill</h1>
    <div class="limericks">
        <!-- Limericks will be added here -->
    </div>
    <script src="script.js"></script>
</body>
</html>
```

### JavaScript Code to Generate Limericks

Create a JavaScript file named `script.js` and add the following code:

```javascript
// List of limericks
const limericks = [
    {
        name: "Bill the economist",
        limerick: "There once was a Bill, an economist so fine, Whose forecasts were always on time. He'd crunch numbers with care, And analyze with flair, And his predictions were truly sublime."
    },
    {
        name: "Bill the brave",
        limerick: "In a land far, far away, There was Bill, who faced each new day, With a heart full of cheer, And a spirit so clear, He'd conquer any obstacle in his way."
    },
    // Add more limericks here...
];

// Function to generate the limericks HTML
function generateLimericks() {
    const limericksDiv = document.querySelector(".limericks");
    limericks.forEach((limerick, index) => {
        const limerickHTML = `
            <div class="limerick">
                <h2>${limerick.name}</h2>
                <p>${limerick.limerick}</p>
            </div>
        `;
        limericksDiv.insertAdjacentHTML("beforeend", limerickHTML);
    });
}

// Call the function to generate the limericks
generateLimericks();
```

### Adding More Limericks

To add more limericks, simply create new objects in the `limericks` array and follow the same format as the existing ones. For example:

```javascript
